utes Australia\",\"Liz Hayes\",\"Charles Wooley\",\"Tara Brown\",\"Liam Bartlett\",\"Allison Langdon\",\"Ellen Fanning\",\"Peter Overton\",\"Ray Martin\",\"Jana Wendt\",\"Jeff McMullen\",\"Jennifer Byrne\",\"Mike Munro\",\"Richard Carleton\",\"Tracey Curro\",\"Peter Harvey\",\"George Negus\",\"Ian Leslie\",\"Gerald Stone\",\"Sarah Abo\",\"double murder\",\"police investigation\",\"belanglo forest\",\"Ivan Milat\",\"suitcase\",\"Karlie Pearce-Stevenson\",\"Khandalyce Pearce\",\"Daniel Holdom\",\"outback murder\"],\"channelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isOwnerViewing\":false,\"shortDescription\":\"On 60 MINUTES, Sarah Abo reveals the incredible account of a police investigation like no other – how detectives solved an horrific double murder they didn’t even know about. It began with the discovery of a woman’s bones in bushland south of Sydney. But police had no idea who the victim was, and despite their substantial efforts, for five years she remained unidentified. Then came another chance discovery – seemingly unrelated – a thousand kilometres away in outback South Australia. In a suitcase lying by the side of a remote highway, a passing motorist found more bones, this time of an infant girl. But again, police were clueless about her identity. It took even more coincidence before the crimes were connected and a tragic breakthrough was uncovered. As it turns out, the two victims were a mother and daughter, murdered by one of the most evil monsters Australia has known.\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Br
